import React from "react"
import {Footer, FooterSection, FooterDropDownSection, FooterLinkList} from "react-mdl"

const Foot = () => {
    return(
        <Footer size="mini" style={{clear: "left"}}>
            <FooterSection type="left" logo="Title">
                <FooterLinkList style={{clear: "left", fontSize: "20px"}}>
                    <a href="#" style={{ fontSize: "20px"}}>Help</a>
                    <a href="#" style={{ fontSize: "20px"}}>Privacy & Terms</a>
                </FooterLinkList>
            </FooterSection>
        </Footer>
    )
}

export default Foot;
